import React from 'react';
import PropTypes from 'prop-types';

const Checkbox = ({ inputType = 'checkbox', inputTypeName, inputDataParamId = null, inputTypeid, inputTypeState = 0, inputTypeDisabled, inputTypeFunction }) => {
    /*const [checkedItem, setCheckedItem] = React.useState(checked);
    const changeCheckedInput = (e) => {
        setCheckedItem(!checked);
        onCheckedChange(e);
    };*/
    return <input type={inputType} name={inputTypeName} dataid={inputDataParamId} id={inputTypeid} checked={inputTypeState} disabled={inputTypeDisabled}
           onChange={inputTypeFunction}/>;
};

Checkbox.propTypes = {
    inputType: PropTypes.string,
    inputTypeName: PropTypes.string.isRequired,
    inputTypeid: PropTypes.number,
    inputDataParamId: PropTypes.number,
    inputTypeState: PropTypes.bool,
    inputTypeDisabled: PropTypes.bool,
    inputTypeFunction: PropTypes.func.isRequired,
};

export default Checkbox;
